import java.util.PriorityQueue;

public class QueueDemo2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		PriorityQueue<Integer> queue = new PriorityQueue<>();
		
		queue.add(34);
		System.out.println(queue);
		
		queue.add(3);
		System.out.println(queue);
		
		queue.add(45);
		System.out.println(queue);
		
		queue.add(12);
		System.out.println(queue);
		
		queue.add(7);
		System.out.println(queue);
	}

}
